          "metadata": {
            "name": "carbonetes-analyzer"
          },
          "spec": {
            "affinity": {},
            "autoscaling": {
              "enabled": false,
              "maxReplicas": 100,
              "minReplicas": 1,
              "targetCPUUtilizationPercentage": 80
            },
            "carbonetesCreds": {
              "password": "your-username",
              "username": "your-password"
            },
            "debugging": {
              "enabled": false
            },
            "fullnameOverride": "",
            "image": {
              "pullPolicy": "Always",
              "repository": "carbonetes/carbonetes-analyzer:1.0.2"
            },
            "imagePullSecrets": [],
            "ingress": {
              "annotations": {},
              "enabled": false,
              "hosts": [
