                  "host": "chart.local",
                  "paths": []
                }
              ],
              "tls": []
            },
            "nameOverride": "",
            "nodeSelector": {},
            "podAnnotations": {},
            "podSecurityContext": {},
            "replicaCount": 1,
            "resources": {},
            "securityContext": {},
            "service": {
              "port": 3000,
              "type": "ClusterIP"
            },
            "serviceAccount": {
              "annotations": {},
              "create": true,
              "name": "carbonetes-analyzer"
            },
            "tolerations": []
          }
        }
      ]
    capabilities: Basic Install
    categories: Security
    certified: "true"
    containerImage: docker.io/carbonetes/operator-bundle:1.0.0
    description: Provides container security and vulnerability analysis.
    createdAt: "2021-06-02T13:31:54.711525+08:00"
    repository: https://github.com/carbonetes/operator
    support: support@carbonetes.com
    operators.operatorframework.io/builder: operator-sdk-v1.3.0
    operators.operatorframework.io/project_layout: helm.sdk.operatorframework.io/v1
  name: carbonetes-operator.v1.0.0
  namespace: carbonetes
spec:
  apiservicedefinitions: {}
  customresourcedefinitions:
    owned:
    - kind: CarbonetesAnalyzer
      name: carbonetesanalyzers.charts.carbonetes.com
      version: v1alpha1
